      })
    }
    render() {
        console.log('LifecycleA render')
        return (
          <div>
            <div>Lifecycle A</div>
            <button onClick={this.changeState}>Change state</button>
            <LifeCycleB/>
          </div>
        )
    }
}

export default LifeCycleA
